function applyFillToRectangles(context, overlayData,indices,tColors,progress,aDigits) {
    indices.forEach(index => {
    const color = overlayData[index].color;    
    const range = overlayData[index].range;
    range.forEach(({ start, end }) => {
        const width = end[0] - start[0];
        const height = end[1] - start[1];
        context.fillStyle = getColor(color,tColors,progress,aDigits); 
        context.fillRect(start[0], start[1], width, height);
    });
})};


function makeHexDarker(hex,amount) {
    let {r,g,b} = hexToRgb(hex);
    r = Math.floor(r * (1 - amount / 100));
    g = Math.floor(g * (1 - amount / 100));
    b = Math.floor(b * (1 - amount / 100));
    return rgbToHex(r,g,b);
}

function makeHexLighter(hex,amount) {
    let {r,g,b} = hexToRgb(hex);
    r = Math.floor(Math.min(255,r + (255 - r) * (amount / 100)));
    g = Math.floor(Math.min(255,g + (255 - g) * (amount / 100)));
    b = Math.floor(Math.min(255,b + (255 - b) * (amount / 100)));
    return rgbToHex(r,g,b);
}

function hexToRgb(hex) {
    let shorthandRegex = /^#?([a-f\d])([a-f\d])([a-f\d])$/i;
    hex = hex.replace(shorthandRegex,function(m,r,g,b) {
        return r + r + g + g + b + b;
    });

    let result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    return result ? {
        r: parseInt(result[1],16),
        g: parseInt(result[2],16),
        b: parseInt(result[3],16)
    } : null;
}

function rgbToHex(r,g,b) {
    return "#" + [r,g,b].map(x => {
        const hex = x.toString(16);
        return hex.length === 1 ? '0' + hex : hex;
    }).join('');
}

function interpolateColor(color1,color2,factor) {
    let result = {};
    result.r = Math.round(color1.r + factor * (color2.r - color1.r));
    result.g = Math.round(color1.g + factor * (color2.g - color1.g));
    result.b = Math.round(color1.b + factor * (color2.b - color1.b));
    return rgbToHex(result.r,result.g,result.b);
}

function interpolateColorHex(hex1,hex2,factor) {
    const rgb1 = hexToRgb(hex1);
    const rgb2 = hexToRgb(hex2);
    return interpolateColor(rgb1,rgb2,factor);
}

async function getMetadata(url,retry = false) {
    try {
        const collectionMetadataRes = await fetch(url);
        return await collectionMetadataRes.json();
    } catch (e) {
        if (!retry) {
            const timestamp = Math.floor(Date.now() / (60000 * 10)) //10 minutes
            const newUrl = `${url}?timestamp=${timestamp}`
            return getMetadata(newUrl,true)
        }
        throw e
    }
}

function simpleHash(input,mintdatetime) {
    const combinedInput = input + mintdatetime;
    let combinedHash = '';

    for (let j = 0; j < 5; j++) {
        let hash = 0;
        for (let i = 0; i < combinedInput.length; i++) {
            const char = combinedInput.charCodeAt(i) + j;
            hash = ((hash << 5) - hash) + char;
            hash |= 0;
        }
        combinedHash += Math.abs(hash).toString();
    }
    return combinedHash.substring(0,Math.max(20,combinedHash.length));
}

function extractDigitsFromHash(selectedColorIndexes) {
    const inputString = selectedColorIndexes.join(',');
    const hashString = simpleHash(inputString);
    const digits = [];
    for (let i = 0; i < 20; i++) {
        digits.push(parseInt(hashString[i]) % 10);
    }
    return digits;
}

function determineNumberOfExtraTraits(hash) {
    if (hash <= 40) {
        return 1;
    } else if (hash <= 65) {
        return 2;
    } else if (hash <= 80) {
        return 3;
    } else if (hash <= 90) {
        return 4;
    } else {
        return 5;
    }
}

function daysBetween(startDate,endDate) {
    const oneDay = 24 * 60 * 60 * 1000; // milliseconds in a day
    return Math.round(Math.abs((endDate - startDate) / oneDay));
}

// Function to calculate the opening date based on runeScore
function calculateOpeningDate(runeScore,totalEggs) {
    const startDate = new Date('2024-02-25');
    const endDate = new Date('2024-04-20');
    const totalDays = daysBetween(startDate,endDate);

    // Calculate the threshold for the top 1%
    const topOnePercentThreshold = Math.ceil(totalEggs * 0.99);

    // Calculate the index for this egg based on its runeScore
    const indexForThisEgg = Math.ceil((runeScore / 100) * totalEggs);

    let daysToAdd;
    if (indexForThisEgg >= topOnePercentThreshold) {
        // For the top 1%,map them to the last days
        const daysForTopOnePercent = Math.ceil(totalDays * 0.01); // Allocate days for top 1%
        const dayWithinTopOnePercent = ((indexForThisEgg - topOnePercentThreshold) / (totalEggs - topOnePercentThreshold)) * daysForTopOnePercent;
        daysToAdd = totalDays - daysForTopOnePercent + dayWithinTopOnePercent;
    } else {
        // For the rest,map them linearly across the available range excluding the top 1%
        const dayRatio = (runeScore - 1) / 99; // Normalize runeScore to 0-1
        const daysForRest = totalDays - Math.ceil(totalDays * 0.01);
        daysToAdd = dayRatio * daysForRest;
    }

    const openingDate = new Date(startDate.getTime() + daysToAdd * 24 * 60 * 60 * 1000);
    return openingDate;
}

function getBackgroundColor(now,stage,progress) {
    if (stage === 1) {
        return interpolateColorHex('#000000',allColors[13][Math.floor(Math.random() * 10)],progress);
    }
    const colors = allColors[14].map(hex => hexToRgb(hex));
    const shiftedHour = (now.getHours() - 8 + 24) % 24 + now.getMinutes() / 60; 

    const totalHours = 24;
    const colorsPerHour = colors.length / totalHours;
    let colorIndex = Math.floor(shiftedHour * colorsPerHour);
    let nextColorIndex = (colorIndex + 1) % colors.length;
    let factor = (shiftedHour * colorsPerHour) - colorIndex;

    colorIndex = colorIndex % colors.length;
    nextColorIndex = nextColorIndex % colors.length;

    let color1 = colors[colorIndex];
    let color2 = colors[nextColorIndex];
    return interpolateColor(color1,color2,factor);
}

function calculateCurrentStage(now,openDate,runeScore) {
    const elapsedDays = (now - openDate) / (1000 * 60 * 60 * 24);

    let cumulativeDays = 0;
    let stage = 0;
    let duration = 0;
    let maxDuration = 28;
    const minDuration = 7;  
    const runePercentile = 70; 
    const gonePercentile = 90;  

    duration = maxDuration - ((runeScore / 100) * (maxDuration - minDuration));

    for (let i = 1; i <= 4; i++) {
        stage = i;
        if (i==4) {
            duration = 297 - ((runeScore / 100) * (297 - minDuration));
        }
        if (elapsedDays < cumulativeDays + duration ||
            (i === 4 && runeScore < gonePercentile) ||
            (i === 3 && runeScore < runePercentile)) {
            break;
        }
        cumulativeDays += duration;
    }

    let progress = (elapsedDays - cumulativeDays) / duration;

    return { stage,progress };
}

if (!window.audio) {
    window.audio = new Audio();
    window.audio.loop = true;
    window.isPlaying = false; 

    window.audio.addEventListener('play', () => {
        window.isPlaying = true;
        updateIconColor(true); 
    });
    window.audio.addEventListener('pause', () => {
        window.isPlaying = false;
        updateIconColor(false); 
    });
}

function createOrUpdateAudioControl(container, soundId) {
    let audioControl = container.querySelector('.audio-control');

    if (!window.audio) {
        window.audio = new Audio();
        window.audio.loop = true;

        window.audio.addEventListener('play', () => {
            updateIconColor(true); 
        });
        window.audio.addEventListener('pause', () => {
            updateIconColor(false); 
        });
    }

    if (!audioControl) {
        audioControl = document.createElement('div');
        audioControl.classList.add('audio-control');
        audioControl.innerHTML = `
            <svg class="speaker-icon" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                <path d="M3,9 v6 h4 l5,5 V4 l-5,5 H3 z"/>
            </svg>`;

        container.appendChild(audioControl);
        audioControl.addEventListener('click', () => togglePlayPause(soundId));
    }

    if (window.audio.src !== `/content/${soundId}`) {
        window.audio.src = `/content/${soundId}`;
    }

    updateIconColor(!window.audio.paused);
}

function togglePlayPause(soundId) {
    if (window.audio.src !== `/content/${soundId}`) {
        window.audio.src = `/content/${soundId}`;
    }
    if (window.audio.paused) {
        window.audio.play().catch(e => console.error("Audio playback failed:", e));
    } else {
        window.audio.pause();
    }
}

function updateIconColor(isPlaying) {
    const speakerIcon = document.querySelector('.speaker-icon');
    if (speakerIcon) { 
        if (isPlaying) {
            speakerIcon.classList.add('playing');
            speakerIcon.classList.remove('paused');
        } else {
            speakerIcon.classList.remove('playing');
            speakerIcon.classList.add('paused');
        }
    } else {
        console.log("Speaker icon not found. Unable to update icon color.");
    }
}


let traitColors,baseCoordinates,artDigits,numberOfExtraTraits,allColors,jsonColorData;

async function conditionalDisplay(container, repeat = false ) {
    try {
        jsonColorData = await getMetadata(collectionJsonUrl);
        allColors = jsonColorData.colors;
        const jsonCoordinateData = await getMetadata(baseJsonUrl);
        baseCoordinates = jsonCoordinateData;

        const inputString = document.querySelector('script[t]').getAttribute('t');
        
        const selectedColorIndexes = Array.from(inputString).map(char => Number(char));
        traitColors = selectedColorIndexes.map((selectedColor,i) => allColors[i] ? allColors[i][selectedColor] : null);
        
        const extractedDigits = extractDigitsFromHash(selectedColorIndexes);
        numberOfExtraTraits = determineNumberOfExtraTraits((extractedDigits[0]*10 + extractedDigits[1]*10)/2);
        
        artDigits = extractedDigits.slice(1);
        const runeScore =((extractedDigits[2]+1)*10 + (extractedDigits[3]+1)*10)/2;
        const openDate = calculateOpeningDate(runeScore,10000);

        const uniqueId = window.currentScriptId;

        let now;
        if (document.querySelector('script[t]').getAttribute('d')) {
            const mintDateTime = document.querySelector('script[t]').getAttribute('d');
            now = new Date(mintDateTime * 1000 * 60);
        } else {
            now = new Date();
        }
        
        if (now < openDate) {
            const [canvas, sound] = generateEgg(traitColors, openDate, now, runeScore);
            soundId = sound;
            updateCanvasContainer(visualContentContainer, canvas, repeat);
        } else {
            const {stage, progress} = calculateCurrentStage(now, openDate, runeScore);
            const [canvas, sound] = generateArt(traitColors, baseCoordinates, artDigits, numberOfExtraTraits, allColors, openDate, now, stage, progress, runeScore);
            soundId = sound;
            updateCanvasContainer(visualContentContainer, canvas, repeat);
        }
        
        return soundId;
    } catch (e) {
        console.error(e);
    }
}
 
function updateCanvasContainer(visualContentContainer, canvas, repeat) {
    visualContentContainer.innerHTML = '';
    visualContentContainer.appendChild(canvas);
    canvas.addEventListener('click', () => conditionalDisplay(visualContentContainer, false));
}

